import Div from 'common/Div';
import styles from './styles';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import { Box, Toolbar, Button, SvgIcon } from '@mui/material';
import { AppBar } from '@material-ui/core';

const Sidebar: React.FC = () => {
  return ( 
    <nav>
      <ol style={styles.sidebar}>
        <li style={styles.listItem}>
          <a href="/user_id" style={styles.linkContainer}>
            <div style={styles.iconContainer}>
              <SvgIcon component={AccountCircleIcon} fontSize="small" />
            </div>
            <span>Моя страница</span>
          </a>
        </li>
        <li style={styles.listItem}>
          <button style={styles.button}>Button 2</button>
        </li>
        <li style={styles.listItem}>
          <button style={styles.button}>Button 3</button>
        </li>
      </ol>
    </nav>
  );
};

export default Sidebar;
